values:
&nbsp;heh. lol im bored.&nbsp;

i went to sign into my facebook and it seems my account has been disabled by an administator. WTF?!?!&nbsp; i did nothing wrong.&nbsp;

well my work will be a bit slack this week "knock on wood"&nbsp; I had Monday off, work 11-6 on tuesday, 115-915 on wednesday, off thursday and work friday and off saterday.&nbsp; usually i only get two days off a week but since i had worked labour day and didnt get my 3 days off that week (i guess i was supposed to?) so i get 3 off this week.&nbsp; we have a new girl atwork now, Ruby.&nbsp; she is pretty cool, new to canada tho so her english isnt great. but she is pretty good with the customers. so now there is Lisa, S the manager, Me the AMIT (assistant manager in training) then there is Ruby the other fultimer,&nbsp; Lisa W, my sister and part time worker and Lavonna the other part timer.&nbsp; so technically it is a full staff but it would be nice to get another person in to pick up some of the slack.&nbsp; Im starting to get more responsibilities at work which i like. paperwork right now. wahoo. lol&nbsp; its not bad tho, gives me a chance to chill in the back room and clear my head.&nbsp;
oh yea, my&nbsp; boss has a super cool sence of humour so its awesome. good atmosphere(most of the time) oh and i got a raise! only 50 cents but its a start :P its retroactive tho so it wont show up till probaly next cheque. oh well a lil extra moolah will be nice.&nbsp;

well, other then work nothing is worth really writing about, all i do is work work work then housework and sleep. i need to get out and do stuff, come on TJ and Rach!&nbsp; heh. all in due time i guess.&nbsp;&nbsp;

1am, work in 10 hrs, i guess ill get some sleep.&nbsp;

goodnite!

Michelle

p.s I HATE MY HAIR!!

MKW
